<div class="text-container"><span class="t s0" style="left:175px;bottom:1043px;letter-spacing:-0.23px;">MANDAT POUR LA CONSTITUTION D’UNE DEMANDE D’AIDE </span>
<span class="t s0" style="left:175px;bottom:1018px;letter-spacing:-0.22px;">EN LIGNE - PROPRIETAIRE OCCUPANT </span>
<span class="t s1" style="left:175px;bottom:996px;letter-spacing:-0.2px;">Articles 1984 et suivants du code civil </span>
<span class="t s2" style="left:86px;bottom:961px;letter-spacing:-0.01px;">Je, soussigné(e) : </span>
<span class="t s3" style="left:86px;bottom:930px;letter-spacing:-0.09px;">M. </span><span class="t s3" style="left:133px;bottom:930px;letter-spacing:-0.13px;">ou Mme </span><span class="t s4" style="left:105px;bottom:927px;">${Q1MMV} </span><span class="t s4" style="left:187px;bottom:927px;">${Q2MMV} </span>
<span class="t s3" style="left:86px;bottom:901px;letter-spacing:-0.13px;">Nom : ${demandeurNom} </span><span class="t s3" style="left:208px;bottom:901px;letter-spacing:-0.13px;">Prénom : ${demandeurPreNom}</span>
<span class="t s3" style="left:111px;bottom:871px;letter-spacing:-0.11px;">Propriétaire </span><span class="t s3" style="left:245px;bottom:871px;letter-spacing:-0.1px;">Autre (préciser) : </span><span class="t s4" style="left:86px;bottom:868px;">${Q3MMV} </span><span class="t s4" style="left:220px;bottom:868px;">${Q4MMV} </span>
<span class="t s3" style="left:86px;bottom:845px;letter-spacing:-0.11px;">du logement à rénover sis au (indiquer l’adresse complète, y compris s’il y en a, les numéros de bâtiments et/ ou d’étages) :</span><span class="t s5" style="left:86px;bottom:825px;">${demandeurAdresse} </span>
<span class="t s3" style="left:317px;bottom:807px;letter-spacing:-0.1px;">tél (mobile et/ ou fixe): +33 ${tel}</span>
<span class="t s3" style="left:215px;bottom:736px;letter-spacing:-0.12px;">(si personne morale, nom-prénom du représentant ayant délégation de signature) </span><span class="t s4" style="left:105px;bottom:733px;">${Q5MMV} </span>
<span class="t s3" style="left:86px;bottom:805px;letter-spacing:-0.09px;">mail: ${mel}</span>
<span class="t s6" style="left:86px;bottom:766px;letter-spacing:-0.13px;">Donne mandat à : </span>
<span class="t s3" style="left:86px;bottom:734px;letter-spacing:-0.09px;">M. </span><span class="t s3" style="left:133px;bottom:734px;letter-spacing:-0.13px;">ou Mme </span><span class="t s4" style="left:187px;bottom:731px;">${Q6MMV} </span>
<span class="t s3" style="left:86px;bottom:707px;letter-spacing:-0.11px;">Nom : ${nom}</span><span class="t s3" style="left:260px;bottom:707px;letter-spacing:-0.11px;">Prénom : ${prenom}</span>
<span class="t s3" style="left:86px;bottom:679px;letter-spacing:-0.11px;">Raison </span><span class="t s3" style="left:170px;bottom:679px;letter-spacing:-0.1px;">sociale </span><span class="t s3" style="left:254px;bottom:679px;letter-spacing:-0.07px;">(si </span><span class="t s3" style="left:309px;bottom:679px;letter-spacing:-0.12px;">personne </span><span class="t s3" style="left:407px;bottom:679px;letter-spacing:-0.1px;">morale): ${raisoc}</span>
<span class="t s3" style="left:90px;bottom:657px;letter-spacing:-0.12px;">adresse complète : ${addresse} </span>
<span class="t s3" style="left:86px;bottom:634px;letter-spacing:-0.09px;">mail: ${mail}</span><span class="t s3" style="left:382px;bottom:634px;letter-spacing:-0.09px;">tél (mobile et/ ou fixe): +33 ${ttel}</span>
<span class="t s6" style="left:86px;bottom:590px;letter-spacing:-0.13px;">Pour effectuer en mon nom et pour mon compte les démarches suivantes sur monprojet.anah.gouv.fr : </span>
<span class="t s6" style="left:86px;bottom:562px;letter-spacing:0.22px;">DEMANDE D’AIDE </span><span class="t s6" style="left:215px;bottom:562px;letter-spacing:-0.12px;">(à cocher si le mandat porte sur cette demande) </span>
<span class="t s4" style="left:90px;bottom:520px;">${Q7MMV} </span>
<span class="t s6" style="left:119px;bottom:536px;letter-spacing:-0.13px;">Je donne mandat pour la constitution de mon dossier de demande d’aide, le dépôt EN LIGNE de ma </span>
<span class="t s6" style="left:119px;bottom:519px;letter-spacing:-0.12px;">demande ainsi que la réception et le traitement de toute correspondance avec l’Anah et ses services. </span>
<span class="t s1" style="left:86px;bottom:495px;letter-spacing:0.07px;">Dans le cas où ma demande d’aide est déposée, </span>
<span class="t s6" style="left:109px;bottom:469px;letter-spacing:-0.14px;">J’ATTESTE: </span>
<span class="t s7" style="left:81px;bottom:454px;">• </span>
<span class="t s1" style="left:90px;bottom:443px;letter-spacing:0.06px;">ne pas avoir commencé les travaux avant le dépôt en ligne de la demande d’aide auprès de l’Anah par le mandataire désigné, </span>
<span class="t s8" style="left:81px;bottom:439px;">- </span>
<span class="t s1" style="left:90px;bottom:423px;letter-spacing:0.07px;">que je n’ai pas acheté mon logement à un organisme HLM depuis moins de cinq ans. </span>
<span class="t s8" style="left:81px;bottom:419px;">- </span>
<span class="t s6" style="left:109px;bottom:377px;letter-spacing:-0.14px;">JE SUIS INFORMÉ(E) QUE CELA M’ENGAGE À: </span>
<span class="t s7" style="left:81px;bottom:361px;">• </span>
<span class="t s9" style="left:90px;bottom:356px;letter-spacing:0.07px;">commencer les travaux dans un délai de un an </span><span class="t s1" style="left:389px;bottom:356px;letter-spacing:0.06px;">suivant la date d’attribution de l’aide </span>
<span class="t s8" style="left:81px;bottom:352px;">- </span>
<span class="t s1" style="left:90px;bottom:336px;letter-spacing:0.06px;">faire réaliser les travaux par des entreprises du bâtiment ayant une activité déclarée en rapport avec les travaux effectués ( </span><span class="t s9" style="left:807px;bottom:336px;letter-spacing:0.07px;">pose et </span>
<span class="t s9" style="left:90px;bottom:316px;letter-spacing:0.07px;">fourniture des matériaux et équipements réalisés par ces dernières </span><span class="t s1" style="left:510px;bottom:316px;letter-spacing:0.06px;">), sauf en cas d’auto-réhabilitation accompagnée par un </span>
<span class="t s1" style="left:90px;bottom:296px;letter-spacing:0.06px;">opérateur spécialisé, </span>
<span class="t s8" style="left:81px;bottom:332px;">- </span>
<span class="t s9" style="left:90px;bottom:276px;letter-spacing:0.08px;word-spacing:0.01px;">terminer les travaux et présenter ma demande de paiement du solde de l’aide dans le délai de trois ans suivant la date </span>
<span class="t s9" style="left:90px;bottom:256px;letter-spacing:0.06px;">d’attribution de l’aide, </span>
<span class="t s8" style="left:81px;bottom:271px;">- </span>
<span class="t s9" style="left:90px;bottom:236px;letter-spacing:0.07px;">occuper mon logement amélioré pendant au moins 6 ans à titre de résidence principale </span><span class="t s1" style="left:640px;bottom:236px;letter-spacing:0.06px;">suivant la date de réception par </span>
<span class="t s1" style="left:90px;bottom:216px;letter-spacing:0.06px;">l’Anah de la demande de paiement du solde de l’aide. </span>
<span class="t s8" style="left:81px;bottom:231px;">- </span>
<span class="t s1" style="left:91px;bottom:180px;letter-spacing:0.06px;">Si vous n’occupez pas encore le logement amélioré, vous avez jusqu’à un an suivant la demande de solde pour y entrer. </span>
<span class="t s1" style="left:91px;bottom:151px;letter-spacing:0.06px;">Si vous supportez la charge des travaux mais n’occupez pas le logement amélioré, l’obligation d’occuper au moins six ans le </span>
<span class="t s1" style="left:91px;bottom:135px;letter-spacing:0.07px;">logement à compter de la demande de solde pèse sur les occupants propriétaires ou sur le ménage modeste que vous hébergez à </span>
<span class="t s1" style="left:91px;bottom:119px;letter-spacing:0.05px;">titre gratuit. </span>
<span class="t sa" style="left:846px;bottom:27px;">1 </span></div>

